a time to be born, 
and a time to die; 
a time to plant, 
and a time to pluck up that which is planted;

a time to kill, 
and a time to heal; 
a time to break down, 
and a time to build up;

a time to weep, 
and a time to laugh; 
a time to mourn, 
and a time to dance;

a time to cast away stones, 
and a time to gather stones together; 
a time to embrace, 
and a time to refrain from embracing;

a time to seek, 
and a time to lose; 
a time to keep, 
and a time to cast away;

a time to tear, 
and a time to sew; 
a time to keep silence, 
and a time to speak;
